import React from 'react';
import './style.css';


import Pageheader from '../../Componentes/Pageheader';


export default function Inicio(){
    return(
        <div>
            <Pageheader/>
            <div id="fundoP" className="container py-5">
                  <div className="d-flex justify-content-center" id="foto">
                        <img id="perfil" className="img-fluid wow fadeInUp" src="https://avatars3.githubusercontent.com/u/62311509?s=460&u=49d3488c7088800a4a4866353fbd68064de814a8&v=4" alt="t"></img>
                  </div>
                      <div>
                            <p id="text-apre">
                                Ol√°! Me Chamo Rodrigo 
                            </p>
                            <p id="text-dsv">
                                 Desenvolvedor Web Front-end e Backend
                            </p>
                            <div className="card-body">
                                    <button id="btnSobre" type="button" className="btn btn">Sobre mim</button>	
                            </div>
                     </div>
                            
                           
            </div>
        </div>

    );
}
